'use strict';

/**
* Chi-square distributed pseudorandom numbers.
*
* @module @stdlib/math/base/random/chisquare
*
* @example
* var rchisq = require( '@stdlib/math/base/random/chisquare' );
*
* var v = rchisq( 6.0 );
* // returns <number>
*
* @example
* var factory = require( '@stdlib/math/base/random/chisquare' ).factory;
*
* var rchisq = factory( 3.0, {
* 	'seed': 297
* });
*
* var v = rchisq();
* // returns <number>
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var chisquare = require( './chisquare.js' );
var factory = require( './factory.js' );


// METHODS //

setReadOnly( chisquare, 'factory', factory );


// EXPORTS //

module.exports = chisquare;
